import React from "react";
import { Card } from "./card";
export const CardList = ({ books }) => {
  return (
    <div className="flex flex-row gap-5 w-11/12 max-w-maxContent">
      {books.map((element, index) => {
        return (
          <div key={index}>
            <Card book={element}></Card>
          </div>
        );
      })}
    </div>
  );
};
